    email: '123@gmail.com',
    phone: '090-1234-5678',
    company: { name: 'test company' },
    website: 'https://google.com',
  };

  return (
    <SContainer>
      <h2>ユーザー一覧です</h2>
      <SearchInput />
      <UserCard />
    </SContainer>
  );
};

const SContainer = styled.div`
  text-align: center;
`;
